// SPDX-License-Identifier: GPL-3.0-or-later

pragma solidity =0.8.4;
import "./interfaces/IUniswapV2Pair.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IFeeHand.sol";

contract FeeHand is IFeeHand{
    address public feeAddress;
    address private _owner;
    IERC20 etCoin;
    constructor(address _address){
        etCoin = IERC20(_address);
    }
    function owner() public view virtual returns (address) {
        return _owner;
    }
    modifier onlyOwner() {
        require(owner() == msg.sender, "Ownable: caller is not the owner");
        _;
    }
    event OwnershipTransferred(address previousOwner, address newOwner);
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    } 
    event SetFeeAddress(address _address);
    function setFeeAddress(address _address)public onlyOwner{
        feeAddress = _address;
        emit SetFeeAddress(_address);
    }
    function burn(address _ipair,address token0,address token1)public override {
        IUniswapV2Pair(_ipair).burn(address(this));     
        uint total0 =IERC20(token0).balanceOf(address(this));   
        uint total1 =IERC20(token1).balanceOf(address(this));
        if(token0 ==address(etCoin)){
            etCoin.transfer(address(0x000000000000000000000000000000000000dEaD), total0);
        }else{
            IERC20(token0).transfer(feeAddress, total0);
        }
        if(token1 ==address(etCoin)){
            etCoin.transfer(address(0x000000000000000000000000000000000000dEaD), total1);
        }else{
            IERC20(token1).transfer(feeAddress, total1);
        }
    }
}

